import logo from './logo.svg';
import './App.css';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import AuthForm from './AuthForm';

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path='/cityjail' element={<AuthForm />}/>
        <Route path='/cityjail/home' element={<Home />}/>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
